import React from "react";
import { View } from "react-native";
import Header from "./componentes/Header";
import SectionHeader from "../../componentes/SectionHeader"

const Loja = () => {
    return (
        <View>
            <Header/>
            <SectionHeader 
            titulo={"Comprar por Categoria"}
            link={"Ver Tudo"}/>
        </View>
    )
}

export default Loja;
